pub fn get_snowflake_root_grammar_id() -> GrammarId {
    GrammarId(5483)
}
pub fn get_snowflake_root_grammar_table() -> RootGrammar {
    RootGrammar::TableDriven {
        grammar_id: get_snowflake_root_grammar_id(),
        tables: &SNOWFLAKE_TABLES,
    }
}
pub fn get_snowflake_root_grammar() -> RootGrammar {
    get_snowflake_root_grammar_table()
}
